import {Schema, model} from 'mongoose';

const programationSchema = new Schema({
    semana_Inicio: {
        type:String,
        required: true
    },
    semana_Fin: {
        type:String,
        required: true
    },
    semana_Programas: 
    [
        {
            type: Schema.ObjectId,
            ref: "Programs"
        }
    ]
})

export default model('Programations',programationSchema);

