import bcrypt from 'bcrypt'

const usersSchema = new Schema({
    nombre_Usuario: {
        type:String,
        required: true,
        unique: true,
        trim: true
    },
    contrasena_Usuario: {
        type:String,
        required: true,
        trim: true
    },
    tipo_Usuario: {
        usuario: {
            type: Boolean,
            default: false
        },
        usuario_web: {
            type: Boolean,
            default: false
        },
        administrador: {
            type: Boolean,
            default: false
        }
    }
})

const saltRounds = 10;

usersSchema.pre('save', function(next){
    if(this.isNew || this.isModified('contrasena_Usuario')){
        const document = this;
        bcrypt.hash(document.contrasena_Usuario, saltRounds, (err, hashedContrasena) =>{
            if(err){
                next(err);
            }else{
                document.contrasena_Usuario = hashedContrasena;
                next();
            }
        })
    }else{
        next();
    }
});

